import React from "react";
import { Link } from "react-router-dom";
import { motion, AnimatePresence } from "framer-motion";
import "./homepage.css";

export const HomePage = () => {
  const wordVariants = {
    hidden: { opacity: 0, y: -50 },
    visible: { opacity: 1, y: 0, transition: { duration: 2 } },
  };

  return (
    <AnimatePresence mode="wait">
      <motion.div
        className="container"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
        key="homepage"
      >
        <div className="home-content">
          <div className="text-container">
            <motion.div
              initial="hidden"
              animate="visible"
              variants={wordVariants}
              className="text-wrapper"
            >
              <motion.span variants={wordVariants} className="text-item">
                JSM
              </motion.span>
            </motion.div>
            <motion.div
              initial="hidden"
              animate="visible"
              variants={wordVariants}
              transition={{ delay: 0.5 }}
              className="text-wrapper"
            >
              <motion.span variants={wordVariants} className="text-item">
                The
              </motion.span>
            </motion.div>
            <motion.div
              initial="hidden"
              animate="visible"
              variants={wordVariants}
              transition={{ delay: 1 }}
              className="text-wrapper"
            >
              <motion.span variants={wordVariants} className="text-item">
                Barber
              </motion.span>
            </motion.div>
          </div>
        </div>
      </motion.div>
    </AnimatePresence>
  );
};

// Example of how to use motion with react-router-dom Link
export const Navigation = () => {
  return (
    <div>
      <Link to="/home">
        <motion.button whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.9 }}>
          HOME
        </motion.button>
      </Link>
      <Link to="/signup">
        <motion.button whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.9 }}>
          SIGNUP
        </motion.button>
      </Link>
      <Link to="/login">
        <motion.button whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.9 }}>
          LOGIN
        </motion.button>
      </Link>
    </div>
  );
};
